import React, { useState } from 'react'
import './App.css';
import MapView from './components/MapView';
import BaseMapSelect from './components/BaseMapSelect'

function App() {
  const [basemap, setBasemap] = useState('topo-vector')
  return (
    <div className="App">
      <MapView url={'https://services.arcgis.com/V6ZHFr6zdgNZuVG0/ArcGIS/rest/services/NYC/SceneServer/layers/0'} basemap={{ basemap }} />
      <BaseMapSelect value={{ basemap }} onChange={{ setBasemap }} />
    </div>
  );
}

export default App;
